@semicolon-fhf-1251

I'm not sure if i should be honored or humiliated being compared to an old woman, but cheers.

Although i don't feel i quite fit the description of Activist for a new business model in the new digital age, i do believe  there is going to be a social and political onslaught in concern with pirating and whether it is a vital freedom, or a devil created from the greed of us all. I think that the planets may have aligned, and i just happened to be the lucky (or unlucky) user to get the last upload in before the buggy server got the better of the site. Nothing big.
